At @lovewellness we want you to know it’s not just you, we’ve been there too. Introducing our New Year, New You campaign✨ 

@lovewellness was born out of my own personal health journey, where I felt alone and like I had exhausted every option (I mean, you really start to feel that way after having 12 yeast infections in 1 year). This year, we’re diving into the issues that every woman has faced- from vaginal infections, to poop problems, to lack of focus, and so much more. Nothing is TMI because we’ve all been there too. 

My hope is that you find community in Love Wellness, feel in control of your health, and find wellness solutions you deserve. My gut says it’s going to be a great year! ❤️

Grab your headphones 🎧 and tune in! I’m honored to have recently been a guest on two of my favorite podcasts – @tokenceo with @erika and @scrubbinginpod with @beccatilley and @tanyarad ❣️

@erika thank you for having me on @tokenceo! It was great talking about my pivot from the entertainment industry, gut, brain and vagina health, why I wanted to create @lovewellness, what it takes to start a business, and so much more.

I had the best time reminiscing with @beccatilley and @tanyarad about my time on Laguna Beach and The Hills and about my new book Love Yourself Well! It’s the ultimate roadmap for modern women looking to take control of their personal wellness in 2023!

